import Link from 'next/link'

class Header extends React.Component {
  constructor(props) {
    super(props);
  }

componentDidMount() {}

render() {
  // const linkStyle = {
  //   marginRight: 15
  // }
  return(
    <div className="container" onClick={this.props.toggleMenu}>
        <div className={"bar bar1 " + (this.props.active ? ' change' : null)}></div>
        <div className={"bar bar2 " + (this.props.active ? ' change' : null)}></div>
        <div className={"bar bar3 " + (this.props.active ? ' change' : null)}></div>

        <style jsx>{`
          .container {
            display: inline-block;
            cursor: pointer;
            align-self: flex-start;
          }

          .bar {
            width: 35px;
            height: 5px;
            background-color: black;
            margin: 6px 0;
            color: white;
          }

          .change.bar1 {
            -webkit-transform: rotate(-45deg) translate(-9px, 6px) ;
            transform: rotate(-45deg) translate(-9px, 6px) ;
          }

          .change.bar2 {
            opacity: 0;
          }

          .change.bar3 {
            -webkit-transform: rotate(45deg) translate(-8px, -8px) ;
            transform: rotate(45deg) translate(-8px, -8px) ;
          }
        `}</style>
      {/* <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link> */}
    </div>
  )};
}
export default Header
